import { Link } from "react-router-dom";

import axios from "axios";

import UserTable from "./UserTable"; // Import UserTable instead of CarTable
import Logout from "./Logout";

import {
  ACCESS_LEVEL_GUEST,
  ACCESS_LEVEL_ADMIN,
  SERVER_HOST,
} from "../config/global_constants";

export default class DisplayAllUsers extends Component {
  constructor(props) {
    super(props);

    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    axios
      .get(`${SERVER_HOST}/users`)
      .then((res) => {
        this.setState({ users: res.data });
      })
      .catch((err) => {
        // Handle error
      });
  }

  render() {
    return (
      <div className="form-container">
        <div className="table-container">
          {localStorage.accessLevel >= ACCESS_LEVEL_ADMIN ? (
            <div className="add-new-car">
              <Link className="blue-button" to={"/AddCar"}>
                Add New Item
              </Link>
            </div>
          ) : null}
          <h2 style={{ textAlign: "center" }}>COLLECTION</h2>
          {/* Render UserTable component passing users as props */}
          <UserTable users={this.state.users} />
          <br />
          <br />
          <br />
        </div>
      </div>
    );
  }
}
